class Solution {
    func makeTheIntegerZero(_ num1: Int, _ num2: Int) -> Int {
        var num1 = num1
        var operations = 0

        while num1 > 0 && operations <= 60 {
            var found = false
            for i in (0...60).reversed() {
                let value = (1 << i) + num2
                if num1 - value >= 0 {
                    num1 -= value
                    operations += 1
                    found = true
                    break
                }
            }
            if !found {
                return -1
            }
        }

        return num1 == 0 ? operations : -1
    }
}
